  function drawFirst() {      
    for (var i = 0; i < json.features.length; i++) {
      var geoArray = moveToCenter(json.features[i].geometry.coordinates[0]);

      for (var j = 0; j < geoArray.length; j++) {
        geoArray[j].x = geoArray[j][0];
        geoArray[j].y = geoArray[j][1];
      }

      var area = polygonArea(geoArray);
      var centroid = polygonCentroid(geoArray);
      var geoData = {};
      geoData.All = geoArray;
      geoData.Area = area;
      geoData.Centroid = centroid;
      geoData.Value = area;
      geoData.Radius = 0;
      geoData.Mass = 0;
      geoData.Desired = 0;
      geoData.Name = json.features[i].properties.Description;
      geoAllArray.push(geoData);
    }

    geoAllInitArray = geoAllArray.slice();

    setInitData();
    
    drawCartogram(true);
  }

  function setInitData() {
  	var totalArea = 0;
    var totalValue = 0;

    for (var j = 0; j < geoAllInitArray.length; j++) {
      totalArea += geoAllInitArray[j].Area;
      totalValue += geoAllInitArray[j].Value;
    }

    var sizeError = new Array();
    for (var j = 0; j < geoAllInitArray.length; j++) {
      geoAllInitArray[j].Desired = totalArea * (geoAllInitArray[j].Value / totalValue);
      geoAllInitArray[j].Radius = Math.sqrt(geoAllInitArray[j].Area / Math.PI);
      geoAllInitArray[j].Mass = Math.sqrt(geoAllInitArray[j].Desired / Math.PI) - Math.sqrt(geoAllInitArray[j].Area / Math.PI);
      sizeError.push(Math.max(geoAllInitArray[j].Area, geoAllInitArray[j].Desired) / Math.min(geoAllInitArray[j].Area, geoAllInitArray[j].Desired));
    }
    var forceReductionFactor = 1 / (1 + arrayMean(sizeError));

    for (var j = 0; j < geoAllInitArray.length; j++) {
      for (var k = 0; k < geoAllInitArray[j].All.length; k++) {
        var deltaVector = { x: 0, y: 0 };
        for (var l = 0; l < geoAllInitArray.length; l++) {
          var pointEdge = geoAllInitArray[j].All[k];
          var pointCentroid = geoAllInitArray[l].Centroid;

          var ang = vectorAngle(pointEdge, pointCentroid);
          var dis = vectorDistance(pointEdge, pointCentroid);
          if (dis > geoAllInitArray[l].Radius) {
            var force = geoAllInitArray[l].Mass * (geoAllInitArray[l].Radius / dis);
          }
          else {
            var force = geoAllInitArray[l].Mass * (Math.pow(dis, 2) / Math.pow(geoAllInitArray[l].Radius, 2)) * (4 - 3 * (dis / geoAllInitArray[l].Radius));
          }
          deltaVector.x += force * Math.cos(ang);
          deltaVector.y += force * Math.sin(ang);
        }
        geoAllInitArray[j].All[k].x += deltaVector.x * forceReductionFactor;
        geoAllInitArray[j].All[k].y -= deltaVector.y * forceReductionFactor;
      }
    }
  }

  function drawCartogram(init) {
    if(init) {
    	drawMap(geoAllInitArray);
    }
    else {
    	cartogramIter();
    }
  }


  function cartogramIter() {
  	var cnt = 0;
    var error = 0;
    interval = window.setInterval(function () {
      cnt++;
      var totalArea = 0;
      var totalValue = 0;

      for (var j = 0; j < geoAllArray.length; j++) {
        var area = polygonArea(geoAllArray[j].All);
        var centroid = polygonCentroid(geoAllArray[j].All);

        geoAllArray[j].Area = area;
        geoAllArray[j].Centroid.x = centroid.x;
        geoAllArray[j].Centroid.y = centroid.y;

        totalArea += geoAllArray[j].Area;
        totalValue += geoAllArray[j].Value;
        console.log("id:" + j + " / " + cnt + " : " + geoAllArray[j].Area + " area / " + geoAllArray[j].Value + " value");
      }
      console.log("[" + cnt + "] Total : " + totalValue + " / Average : " + totalArea / 25);

      var sizeError = new Array();
      for (var j = 0; j < geoAllArray.length; j++) {
        geoAllArray[j].Desired = totalArea * (geoAllArray[j].Value / totalValue);
        geoAllArray[j].Radius = Math.sqrt(geoAllArray[j].Area / Math.PI);
        geoAllArray[j].Mass = Math.sqrt(geoAllArray[j].Desired / Math.PI) - Math.sqrt(geoAllArray[j].Area / Math.PI);
        sizeError.push(Math.max(geoAllArray[j].Area, geoAllArray[j].Desired) / Math.min(geoAllArray[j].Area, geoAllArray[j].Desired));
      }

      var totalErrorTemp = 0;
      for (var j = 0; j < geoAllArray.length; j++) {
        totalErrorTemp += Math.abs(geoAllArray[j].Area - geoAllArray[j].Desired);
      }

      var forceReductionFactor = 1 / (1 + arrayMean(sizeError));

      for (var j = 0; j < geoAllArray.length; j++) {
        for (var k = 0; k < geoAllArray[j].All.length; k++) {
          var deltaVector = { x: 0, y: 0 };
          for (var l = 0; l < geoAllArray.length; l++) {
            var pointEdge = geoAllArray[j].All[k];
            var pointCentroid = geoAllArray[l].Centroid;

            var ang = vectorAngle(pointEdge, pointCentroid);
            var dis = vectorDistance(pointEdge, pointCentroid);
            if (dis > geoAllArray[l].Radius) {
                var force = geoAllArray[l].Mass * (geoAllArray[l].Radius / dis);
            }
            else {
                var force = geoAllArray[l].Mass * (Math.pow(dis, 2) / Math.pow(geoAllArray[l].Radius, 2)) * (4 - 3 * (dis / geoAllArray[l].Radius));
            }
            deltaVector.x += force * Math.cos(ang);
            deltaVector.y += force * Math.sin(ang);
          }
          geoAllArray[j].All[k].x += deltaVector.x * forceReductionFactor;
          geoAllArray[j].All[k].y -= deltaVector.y * forceReductionFactor;
        }
      }
      drawMap(geoAllArray);

      $('#minimap').empty();
      $('#minimap').append("Iteration이 " + cnt + "번 진행 중입니다. 현재 평균넓이오차 는 " + (totalErrorTemp / 25) + "입니다.");

      if ((totalErrorTemp / 25) < 5) {
        clearInterval(interval);
        interval = null;
        drawMap(geoAllArray);

        $('#minimap').empty();
        $('#minimap').append("Iteration이 " + cnt + "번 진행 후 완료 되었습니다. 최종 평균넓이오차 는 " + (totalErrorTemp / 25) + "입니다.");
      }
      error = totalErrorTemp / 25;
    }, 100);
  }

