  function vectorAngle(pt1, pt2) {
    var d1 = pt1.x - pt2.x;
    var d2 = pt2.y - pt1.y;
    var theta = Math.atan2(d2, d1);

    return theta;
  }

  function vectorDistance(pt1, pt2) {
    var d = Math.pow((pt1.x - pt2.x), 2) + Math.pow((pt1.y - pt2.y), 2);

    return Math.sqrt(d);
  }

  function arrayMean(arr) {
    var sum = 0, len = arr.length;
    for (var i = 0; i < len; i++) {
      sum += arr[i];
    }

    return sum / len;
  }

  function polygonArea(geoArr) {
    var area = 0;         // Accumulates area in the loop
    var j = geoArr.length - 1;  // The last vertex is the 'previous' one to the first

    for (var i = 0; i < geoArr.length; i++) {
      area = area + (geoArr[i].x + geoArr[j].x) * (geoArr[i].y - geoArr[j].y);
      j = i;  //j is previous vertex to i
    }

    return area / 2;
  }

  function polygonCentroid(geoArr) {
    var twicearea = 0,
    x = 0, y = 0,
    nPts = geoArr.length,
    p1, p2, f;
    for (var i = 0, j = nPts - 1 ; i < nPts ; j = i++) {
      f = geoArr[i].x * geoArr[j].y - geoArr[j].x * geoArr[i].y;
      twicearea += f;
      x += (geoArr[i].x + geoArr[j].x) * f;
      y += (geoArr[i].y + geoArr[j].y) * f;
    }
    f = twicearea * 3;
   
    return { x: x / f, y: y / f };
  }

  var xMin = 179404; var xMax = 216086;
  var yMin = 436339; var yMax = 466516;

  function moveToCenter(geoArr) {
    var xAver = (xMin + xMax) / 2;
    var yAver = (yMin + yMax) / 2;

    for (var i = 0; i < geoArr.length; i++) {
      geoArr[i][0] = geoArr[i][0] - xAver;
      geoArr[i][1] = -1 * (geoArr[i][1] - yAver);
    }

    var divFactor = 0;
    if ((xMax - xMin) > ((yMax - yMin) * 5 / 2)) divFactor = (xMax - xMin) / (canvasWidth);
    else divFactor = (yMax - yMin) / (canvasWidth * 2 / 5);

    for (var i = 0; i < geoArr.length; i++) {
      geoArr[i][0] = (geoArr[i][0] / divFactor) + canvasWidth / 2;
      geoArr[i][1] = (geoArr[i][1] / divFactor) + ((yMax - yAver) / divFactor);
    }

    return geoArr;
  }

  function increase_brightness(hex, percent) {
    // strip the leading # if it's there
    if (percent < 1) percent = 1;
    if (percent > 90) percent = 90;

    hex = hex.replace(/^\s*#|\s*$/g, '');

    // convert 3 char codes --> 6, e.g. `E0F` --> `EE00FF`
    if (hex.length == 3) {
      hex = hex.replace(/(.)/g, '$1$1');
    }

    var r = parseInt(hex.substr(0, 2), 16),
	      g = parseInt(hex.substr(2, 2), 16),
        b = parseInt(hex.substr(4, 2), 16);

    return '#' +
     ((0 | (1 << 8) + r + (256 - r) * percent / 100).toString(16)).substr(1) +
     ((0 | (1 << 8) + g + (256 - g) * percent / 100).toString(16)).substr(1) +
     ((0 | (1 << 8) + b + (256 - b) * percent / 100).toString(16)).substr(1);
  }

  function chooseData(settingData) {
    if (interval != null) {
      clearInterval(interval);
      interval = null;
    }
    drawCartogram(true);
    for (var i = 0; i < geoAllArray.length; i++) {
      geoAllArray[i].Value = settingData[i];
    }
    drawCartogram(false);
  }

